    var choiceElement=choices[choiceNum];

    const handleClick=()=>{
            setChoiceNum(choiceNum+1);  
    }
    console.log(choiceElement.key)
    if(choiceNum<2){
        return ( 
            <div className="choice-list" >
                <h2>{choiceElement.title}</h2>
                <button onClick={handleClick}>{choiceElement.choice1}</button>
                <button onClick={handleClick}>{choiceElement.choice2}</button>
            </div>
         );

    }
    else{
        return(
            <div className='choice-end'>
            <h1>link put here</h1>
        </div>
        );

    }

}

